import React from "react";
import ReactDom from "react-dom";

//CSS
import "./index.css";

//setup vars
const title = "The Bear and The Fern";
const author = "Shashank Pandey";
const img =
  "https://m.media-amazon.com/images/W/WEBP_402378-T2/images/I/51nvk2Smg3L._SX218_BO1,204,203,200_QL40_FMwebp_.jpg";

function Booklist() {
  return (
    <section className="booklist">
      <Book job="developer" />
      <Book title="random-dev" />
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
      <Book />
    </section>
  );
}

const Book = (props) => {
  console.log(props);
  return (
    <article className="book">
      <img src={img} alt=" " />
      <h1>{title.toUpperCase()}</h1>
      <h5>{author}</h5>
      <p>{props.job}</p>
      <p>{props.title}</p>
    </article>
  );
};

ReactDom.render(<Booklist />, document.getElementById("root"));
